import React from "react";
import '../Components/About.css'
import { ReactComponent as WorkIcon } from "../Images/work.svg";
import { ReactComponent as SchoolIcon } from "../Images/school.svg";
import AWSLogo from "../Images/AWS.png";
import CSSLogo from "../Images/CSS.png";
import HTMLLogo from "../Images/HTML.png";
import JavaLogo from "../Images/Java.png";
import JavaScriptLogo from "../Images/JavaScript.png";
import PythonLogo from "../Images/Python.png";
import ReactLogo from "../Images/React.png";
import TerraformLogo from "../Images/Terraform.png";

function isInViewport(element) {
    const rect = element.getBoundingClientRect();
    return (
      rect.top >= 0 &&
      rect.left >= 0 &&
      rect.bottom <= (window.innerHeight || document.documentElement.clientHeight) &&
      rect.right <= (window.innerWidth || document.documentElement.clientWidth)
    );
}

window.addEventListener('scroll', () => {
    const skillsSection = document.querySelector('.skills');
    if (isInViewport(skillsSection)) {
      skillsSection.classList.add('skills-animate', 'active');
    }
});
  

import TimelineElements from "../Components/TimelineElements";

import {
  VerticalTimeline,
  VerticalTimelineElement,
} from "react-vertical-timeline-component";

import "react-vertical-timeline-component/style.min.css";

export default function About() {
  let workIconStyles = { background: "cyan" };
  let schoolIconStyles = { background: "cyan" };

  return (
    <div className="about-me">
        <div>
            <h1 className="title">My Experience</h1>
            <VerticalTimeline >
                {TimelineElements.map((element) => {
                let isWorkIcon = element.icon === "work";

                return (
                    <VerticalTimelineElement
                        key={element.key}
                        date={element.date}
                        dateClassName="date"
                        iconStyle={isWorkIcon ? workIconStyles : schoolIconStyles}
                        icon={isWorkIcon ? <WorkIcon /> : <SchoolIcon />}
                        >
                        <h3 className="vertical-timeline-element-title">
                            {element.title}
                        </h3>
                        <h5 className="vertical-timeline-element-subtitle">
                            {element.location}
                        </h5>
                        <p id="description">{element.description}</p>
                    </VerticalTimelineElement>
                );
            })}
            </VerticalTimeline>
        </div>

        <div skills skills-animate>
            <h1 className="skills-title">My Skills</h1>
            <div className="skills">
                <div className="skills-container">
                    <h1 className="skills-header">Front-End</h1>
                    <ul className="skills-list">
                        <li>
                            <img src={JavaScriptLogo} className="skills-logo"/>
                            <p className="list-text">JavaScript</p>
                        </li>
                        <li>
                            <img src={ReactLogo} className="skills-logo"/>
                            <p className="list-text">React</p>
                        </li>
                        <li>
                            <img src={CSSLogo} className="skills-logo"/>
                            <p className="list-text">CSS</p>
                        </li>
                        <li>
                            <img src={HTMLLogo} className="skills-logo"/>
                            <p className="list-text">HTML</p>
                        </li>
                    </ul>
                </div>
                <div className="skills-container">
                    <h1 className="skills-header">Back-End</h1>
                    <ul className="skills-list">
                        <li>
                            <img src={JavaLogo} className="skills-logo"/>
                            <p className="list-text">Java</p>
                        </li>
                        <li>
                        <img src={PythonLogo} className="skills-logo"/>
                            <p className="list-text">Python</p>
                        </li>
                        <li>
                            <img src={TerraformLogo} className="skills-logo"/>
                            <p className="list-text">Terraform</p>
                        </li>
                        <li>
                            <img src={AWSLogo} className="skills-logo"/>
                            <p className="list-text">AWS</p>
                        </li>
                    </ul>
                </div>
            </div>
        </div>
    </div>
  );
}
